    taskAppModule.taskCanceled(mode.getMessenger(),["editCom","editComFile"],["editCom","selectCid"]);
}

//=====================================
// Initialize Data Methods
//=====================================

this.createCombinedEntries = function(initialComFileEntries,metaFiles) {

    var newCombinedEntries = [];

    var tempMap = {};

    var addMetaFileToMap = (record) => {
        var combinedEntry = {}
        combinedEntry.metaFile = record;
        combinedEntry.selected = false;
        tempMap[record.Id] = combinedEntry;
        newCombinedEntries.push(combinedEntry);
    }
    metaFiles.forEach(addMetaFileToMap);

    var addComFileEntryToMap = (record) => {
        var combinedEntry = tempMap[record.Fields.meta_file_id];
        if(combinedEntry === undefined) {
            throw new Error("file entry not found: fileEntryId=" + record.Fields.file_entry_id);
        }
        combinedEntry.comFileEntry = record;
        combinedEntry.fileGroup = record.Fields.file_group;
        combinedEntry.selected = true;
    }
    initialComFileEntries.forEach(addComFileEntryToMap);

    this.combinedEntries = newCombinedEntries;
}

//=====================================
// Load Methods
//=====================================

this.loadEntries = function() {
    apogeeapp.ui.removeAllChildren(this.overridesCell);
    for(var fileType in this.baseCells) {
        apogeeapp.ui.removeAllChildren(this.baseCells[fileType]);
    }
    apogeeapp.ui.removeAllChildren(this.availableCell);

    var addCombinedEntry = (combinedEntry) => {
        var cellElement = this.createCell(combinedEntry);
        if(combinedEntry.selected) {
            if(combinedEntry.fileGroup == "base") {
                var fileTypeId = combinedEntry.metaFile.Fields.file_type_id;
                var fileTypeName = this.fileTypeIdToName[fileTypeId];
                var baseCell = this.baseCells[fileTypeName];
                baseCell.appendChild(cellElement);
            }
            else if(combinedEntry.fileGroup == "overrides") {
                this.overridesCell.appendChild(cellElement);
            }
            else {
            }
        }
        else {
            this.availableCell.appendChild(cellElement);
        }
    }

    this.combinedEntries.forEach(addCombinedEntry);
}

this.createCell = function(combinedEntry) {

    var metaFileFields = combinedEntry.metaFile.Fields

    var fileType = this.fileTypeIdToName[metaFileFields.file_type_id];

    var name = fileType + " - " +  metaFileFields.name + " - " + metaFileFields.file_context;

    var div = document.createElement("div");
    div.id = CELL_ID_PREFIX + combinedEntry.metaFile.Id;

    //draggable interface
    div.draggable = true;
    var instance = this;
    div.ondragstart = (event) => this.onDragStart(event,fileType);

    var text = document.createTextNode(name);
    div.appendChild(text);

    return div;
}

//=================================
// Drag and drop edit methods
//=================================

this.setCellDragMethods = function(cell,fileType) {
    cell.ondragover = (event) => this.allowDrop(event,fileType);
    cell.ondrop = (event) => this.onSelectedDrop(event,"base",fileType);
}

this.onDragStart = function(event,fileType) {
    event.dataTransfer.setData("id",event.target.id);
    event.dataTransfer.setData("fileType",fileType);
}

this.allowDrop = function(event,fileType) {
    //I don't know why this is not working - I put the test in the on drop method. it would be better here.
    // if(fileType !== undefined) {
    //     var dragFileType = event.dataTransfer.getData("fileType");
    //     var destFileType = this.fileTypeNameToId[fileType];
    //     if(dragFileType == destFileType) {
    //         event.preventDefault();
    //     }
    // }
    // else {
        event.preventDefault();
    // }
}

this.onSelectedDrop = function(event,fileGroup,fileType) {
    var data = event.dataTransfer.getData("id");
    var combinedEntry = this.lookupCombinedEntry(data);

    //this is here because I couldn't get it to work in allowDrop
    if(fileType) {
       var draggedFileType = event.dataTransfer.getData("fileType",fileType);
       if(draggedFileType != fileType) {
           alert("Incorrect location for this file type: " + draggedFileType);
           return;
       }
    }

    combinedEntry.selected = true;
    combinedEntry.fileGroup = fileGroup;
    this.loadEntries();

}

this.onAvailableDrop = function(event) {
    var data = event.dataTransfer.getData("id");
    var combinedEntry = this.lookupCombinedEntry(data);

    if(combinedEntry.selected) {
        combinedEntry.selected = false;
        this.loadEntries();
    }
}

this.lookupCombinedEntry = function(divId) {
    var metaFileId = divId.substr(PREFIX_LENGTH);

    var combinedEntry = this.combinedEntries.find( (entry) => (entry.metaFile.Id == metaFileId) );
    if(!combinedEntry) {
        alert("Error: dragged object not found in data");
        return null;
    }

    return combinedEntry;
}

